              & -2.67778774134020507D-002, 0.37340903803342568D0, &                                                       
              & 9.7044114298992739D0, 10.857114309250189D0, 10.857114309250189D0, &                                           
              & 0.32007469575680908D0, 2.65035643947172384D-002, 2.65035643947172384D-002, &                              
              & -2.67778774134020507D-002, 0.37340903803342568/                                                         

!----------------------------------------------------------------------!
!          Transforms xyz, grad and hess from internal coordinates     !
!           q = B x      B+ g' = g    B+ h' B + dB+ g' = h             !
!                                                                      !
!  dV/dx = dV/dq dq/dx    d2V/dx2 = d2V/dq2 (dq/dx)2 + dV/dq d2q/dx2   !
!----------------------------------------------------------------------!

     ij=0
     do i = 1,natoms
      do j = 1,i-1
       ij=ij+1
       r(1:3)=x(1:3,i)-x(1:3,j)
       rij=r(1)**2+r(2)**2+r(3)**2
       dist(ij)=dsqrt(rij)
      enddo
     enddo

     if (iopt.ge.1) then

      ! build B matrix  dr/dx  from r = |xi-xj|
      B=0.d0
      if (iopt.ge.2) db=0.d0
      ij=0
      do i = 1,natoms
       do j = 1,i-1
        ij=ij+1 !equivalent to (i-2)*i +j?
        ix=(i-1)*3
        jx=(j-1)*3
        r(1:3)=x(1:3,i)-x(1:3,j)
        rrij=r(1)**2+r(2)**2+r(3)**2
        rrij=1.d0/dsqrt(rrij)
        r(1:3)=rrij*r(1:3)
        B(ij,ix+1:ix+3) =  r(1:3)
        B(ij,jx+1:jx+3) = -r(1:3)
        if (iopt.ge.2) then  ! dB/dx 
         do k = 1,3
          dB(ij,ix+k,ix+k) =  rrij
          dB(ij,jx+k,jx+k) =  rrij
          dB(ij,ix+k,jx+k) = -rrij
          dB(ij,jx+k,ix+k) = -rrij
         enddo
         do k = 1,3
          do l = 1,3
           d0 = r(k)*r(l)*rrij
           dB(ij,ix+k,ix+l) = dB(ij,ix+k,ix+l) - d0
           dB(ij,jx+k,jx+l) = dB(ij,jx+k,jx+l) - d0
           dB(ij,ix+k,jx+l) = dB(ij,ix+k,jx+l) + d0
           dB(ij,jx+k,ix+l) = dB(ij,jx+k,ix+l) + d0
          enddo
         enddo
        end if
       enddo
      enddo

   end if

     if (iopt.eq.0) then

       e=shift

       do i = 1,nmorse
         ii=imorse(i)
         r(1)=dist(ii)
         call v_morse(morse(1,i),morse(2,i),morse(3,i),r(1),v)
         e = e+v
       enddo

       do i = 1,ng1d
         ii=ig1d(i)
         r(1)=dist(ii)
         call v_gauss(1,r,g1d(1,i),g1d(2,i),g1d(3,i),g1d(4,i),v)
         e = e+v
       enddo

       do i = 1,ng2d
         do j = 1,2
          ii=ig2d(j,i)
          r(j)=dist(ii)
         enddo
         call v_gauss(2,r,g2d(1,i),g2d(3,i),g2d(5,i),g2d(6,i),v)
         e = e+v
       enddo

       do i = 1,ng3d
         do j = 1,3
          ii=ig3d(j,i)
          r(j)=dist(ii)
         enddo
         call v_gauss(3,r,g3d(1,i),g3d(4,i),g3d(7,i),g3d(8,i),v)
         e = e+v
       enddo

     end if

     if (iopt.ge.1) then

      g=0.d0
      gint=0.d0

      do i = 1,nmorse
        ii=imorse(i)
        r(1)=dist(ii)
        call f_morse(morse(1,i),morse(2,i),morse(3,i),r(1),gg(1))
        gint(ii) = gint(ii)-gg(1)
      enddo

      do i = 1,ng1d
        ii=ig1d(i)
        r(1)=dist(ii)
        call f_gauss(1,r,g1d(1,i),g1d(2,i),g1d(3,i),g1d(4,i),gg)
        gint(ii) = gint(ii)+gg(1)
      enddo

      do i = 1,ng2d
       do j = 1,2
        ii=ig2d(j,i)
        r(j)=dist(ii)
       enddo
       call f_gauss(2,r,g2d(1,i),g2d(3,i),g2d(5,i),g2d(6,i),gg)
       do j = 1,2
        ii=ig2d(j,i)
        gint(ii) = gint(ii)+gg(j)
       enddo
      enddo

      do i = 1,ng3d
       do j = 1,3
        ii=ig3d(j,i)
        r(j)=dist(ii)
       enddo
       call f_gauss(3,r,g3d(1,i),g3d(4,i),g3d(7,i),g3d(8,i),gg)
       do j = 1,3
        ii=ig3d(j,i)
        gint(ii) = gint(ii)+gg(j)
       enddo
      enddo

      do i = 1,3*natoms
       do j = 1,ndist
        g(i) = g(i) + B(j,i) * gint(j)
       enddo
      enddo

     end if


     if (iopt.ge.2) then

      h = 0.d0
      hint = 0.d0

      do i = 1,nmorse
        ii=imorse(i)
        r(1)=dist(ii)
        call h_morse(morse(1,i),morse(2,i),morse(3,i),r(1),hh(1))
        ij = (ii-1)*ii/2 + ii
        hint(ij) = hint(ij)+hh(1)
      enddo

      do i = 1,ng1d
        ii=ig1d(i)
        r(1)=dist(ii)
        call h_gauss(1,r,g1d(1,i),g1d(2,i),g1d(3,i),g1d(4,i),hh)
        ij = (ii-1)*ii/2 + ii
        hint(ij) = hint(ij)+hh(1)
      enddo

      do i = 1,ng2d
       do j = 1,2
        ii=ig2d(j,i)
        r(j)=dist(ii)
       enddo
       call h_gauss(2,r,g2d(1,i),g2d(3,i),g2d(5,i),g2d(6,i),hh)
       ij = 0
       do j = 1,2
        do k = 1,j
         ij=ij+1
         ii=ig2d(j,i)
         jj=ig2d(k,i)
         call iorder(jj,ii)
         kl = (ii-1)*ii/2 + jj
         hint(kl) = hint(kl)+hh(ij)
        enddo
       enddo
      enddo

      do i = 1,ng3d
       do j = 1,3
        ii=ig3d(j,i)
        r(j)=dist(ii)
       enddo
       call h_gauss(3,r,g3d(1,i),g3d(4,i),g3d(7,i),g3d(8,i),hh)
       ij = 0
       do j = 1,3
        do k = 1,j
         ij=ij+1
         ii=ig3d(j,i)
         jj=ig3d(k,i)
         call iorder(jj,ii)
         kl = (ii-1)*ii/2 + jj
         hint(kl) = hint(kl)+hh(ij)
        enddo
       enddo
      enddo

      ij = 0
      do i = 1,3*natoms
       do j = 1,i
        ij = ij +1
        do k = 1,ndist
         h(ij) = h(ij) + dB(k,j,i) * gint(k)
        enddo
       enddo
      enddo

      ! reuse dB as scratch 
      dB(:,:,1)=0.d0
      do j = 1,3*natoms
       kl = 0
       do k = 1,ndist
        do l = 1,k-1
         kl = kl+1
         dB(k,j,1) = dB(k,j,1) + hint(kl) * B(l,j)
         dB(l,j,1) = dB(l,j,1) + hint(kl) * B(k,j)
        enddo
        kl = kl+1
        dB(k,j,1) = dB(k,j,1) + hint(kl) * B(k,j)
       enddo
      enddo

      ij = 0
      do i = 1,3*natoms
       do j = 1,i
        ij = ij + 1
        do k = 1,ndist
         h(ij) = h(ij) + B(k,i) * dB(k,j,1)
        enddo
       enddo
      enddo

     end if

!----------------------------------------------------------------------!
     return

    end subroutine pes
!======================================================================!

!----------------------------------------------------------------------!
      subroutine v_morse(re,al,de,r,v)
!----------------------------------------------------------------------!
!       Purpose: Evaluate V(r) = De**2*(1-exp(-alpha*(r-re)))**2       !
!----------------------------------------------------------------------!
        double precision, intent(in)  :: al,re,de,r
        double precision, intent(out) :: v

        v = al*(re-r)
        v = dexp(v) - 1.d0
        v = (de*v)**2
        return

      end subroutine v_morse
!----------------------------------------------------------------------!

!----------------------------------------------------------------------!
      subroutine f_morse(re,al,de,r,f)
!----------------------------------------------------------------------!
!       Purpose: Evaluate -dV(r)/dr  = dV(r)/d re
!----------------------------------------------------------------------!
        double precision, intent(in)  :: al,re,de,r
        double precision, intent(out) :: f

        f = al*(re-r)
        f = dexp(f)
        f = f*(f-1.d0)
        f = f*2d0*al*de**2

        return

      end subroutine f_morse
!----------------------------------------------------------------------!

!----------------------------------------------------------------------!
      subroutine h_morse(re,al,de,r,h)
!----------------------------------------------------------------------!
!       Purpose: Evaluate d2V(r)/dr2
!----------------------------------------------------------------------!
        double precision, intent(in)  :: al,re,de,r
        double precision, intent(out) :: h

        h = al*(re-r)
        h = dexp(h)
        h = h*(2.d0*h-1.d0)
        h = h*2d0*al**2*de**2

        return

      end subroutine h_morse
!----------------------------------------------------------------------!

!----------------------------------------------------------------------!
      subroutine v_gauss(ndim,r,x,alpha,d,shift,v)
!----------------------------------------------------------------------!
!       Purpose: Evaluate V(r) = D ( exp(- 0.5 a rx**2 ) - shift )
!----------------------------------------------------------------------!
        integer,          intent(in)  :: ndim
        double precision, intent(in)  :: r(ndim), alpha(ndim), x(ndim), d, shift
        double precision, intent(out) :: v

        integer :: i

        v = 0.d0
        do i = 1,ndim
          v = v + (r(i)-x(i))**2 * alpha(i)
        enddo
        v = v * 0.5d0
        v = dexp(-v) - shift
        v = v*d

        return

      end subroutine v_gauss
!----------------------------------------------------------------------!
!----------------------------------------------------------------------!
      subroutine f_gauss(ndim,r,x,alpha,d,shift,v)
!----------------------------------------------------------------------!
!       Purpose: Evaluate dV/dr
!----------------------------------------------------------------------!
        integer,          intent(in)  :: ndim
        double precision, intent(in)  :: r(ndim), alpha(ndim), x(ndim), d, shift
        double precision, intent(out) :: v(ndim)

        double precision :: vv
        integer :: i

        vv = 0.d0
        do i = 1,ndim
          vv = vv + (r(i)-x(i))**2 * alpha(i)
        enddo
        vv = vv * 0.5d0
        vv = dexp(-vv)
        vv = vv*d

        do i = 1,ndim
          v(i) = - vv * (r(i)-x(i)) * alpha(i)
        enddo

        return

      end subroutine f_gauss
!----------------------------------------------------------------------!

!----------------------------------------------------------------------!
      subroutine h_gauss(ndim,r,x,alpha,d,shift,h)
!----------------------------------------------------------------------!
!       Purpose: Evaluate d2V/dr2
!----------------------------------------------------------------------!
        integer,          intent(in)  :: ndim
        double precision, intent(in)  :: r(ndim), alpha(ndim), x(ndim), d, shift
        double precision, intent(out) :: h(ndim*(ndim+1)/2)

        double precision :: vv, fi
        integer :: i, j , ij

        vv = 0.d0
        do i = 1,ndim
          vv = vv + (r(i)-x(i))**2 * alpha(i)
        enddo
        vv = vv * 0.5d0
        vv = dexp(-vv)
        vv = vv*d

        ij=0
        do i = 1,ndim
         fi = (r(i)-x(i)) * alpha(i)
         do j = 1,i
          ij=ij+1
          h(ij) = vv * fi * (r(j)-x(j)) * alpha(j)
         enddo
         h(ij) = h(ij) - alpha(i) * vv
        enddo

        return

      end subroutine h_gauss
!----------------------------------------------------------------------!

!----------------------------------------------------------------------!
  subroutine iorder(i,j)
   ! permute i,j such that i < j
   implicit none
   integer :: i, j, k
    if (i.le.j) return
    k=i
    i=j
    j=k
  end subroutine iorder
!----------------------------------------------------------------------!
